  KEY `idx_update_time` (`update_time`) USING BTREE,
  KEY `idx_task_id` (`message_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=318176547489979394 DEFAULT CHARSET=utf8mb4 COMMENT='订阅者状态确认表';

